import "../Styles/ErrorBox.css";
const ErrorBox = () => {
  return (
    <>
      <div>
        <div className="Error-header">Errors</div>
        <div className="Error-container">
          <p>Error Box</p>
        </div>
      </div>
    </>
  );
};
export default ErrorBox;
